import { NavLink } from "react-router-dom";


const Form =()=>{
    return(
        <div>
        <NavLink to="/form">
           <form>

            <label htmlFor="email">Email</label>
            <input type="text"/>

            </form>
            
            </NavLink> 
        </div>
    )
    
}


export default Form;
